import { useState } from "react";
const Cartdisplay=(props)=>{
    const {count,setCount,mobilesData} = props;

    const [mobData, setMobData] = useState(mobilesData.filter((val) => {

        return count.indexOf(val.model) > -1

    }).map((dat) => {
        return (


            <div className="details-indepth ">
                
             {dat.model}

            </div>

        )
    }))
    return(
        <>

      {mobData}
        </>
    )

}

export default Cartdisplay
